import Box from "@mui/icons-material/Box";
import Navbar from "scenes/navbar";

const HomePage = () => {
    return (
    <Box
    sx={{
        width: 300,
        height: 300,
        backgroundColor: 'primary.dark',
        '&:hover': {
          backgroundColor: 'primary.main',
          opacity: [0.9, 0.8, 0.7],
        },
      }}>
        <Navbar />

    </Box>)

}

export default HomePage;
